  private static void checkRepeat(String str) {
    StringBuilder sb = new StringBuilder();
    StringBuilder sb2 = new StringBuilder();
    java.util.HashSet<Character> seen = new java.util.HashSet<>();

    for (char c : str.toCharArray()) {
      if (!seen.contains(c)) {
        seen.add(c);
        sb.append(c);
      } else {
        sb2.append(c);
      }
    }
    if (sb2.length() == 0) {
      System.err.println("没有重复文字");
    } else {
      System.err.println("重复文字：" + sb2);
    }
  }

  private static void checkContain(String s1, String s2) {
    // 将 s2 的字符放入 Set
    Set<Character> set = new HashSet<>();
    for (char c : s2.toCharArray()) {
      set.add(c);
    }
    StringBuilder sb = new StringBuilder();
    // 打印 s1 中不存在于 s2 的字符
    for (char c : s1.toCharArray()) {
      if (!set.contains(c)) {
        sb.append(c);
      }
    }
    if (sb.length() == 0) {
      System.err.println("文字全部包含");
    } else {
      System.err.println("不包含的文字：" + sb);
    }
  }

  private static String removeDuplicateChars(String input) {
    // 使用 LinkedHashSet 保证唯一性且维持顺序
    Set<Character> set = new LinkedHashSet<>();
    for (char c : input.toCharArray()) {
      set.add(c);
    }

    // 重新构建字符串
    StringBuilder sb = new StringBuilder();
    for (Character character : set) {
      sb.append(character);
    }
    return sb.toString();
  }
